import React from "react";

const VideoList = (props) => {
    console.log()
    const test = props.Response.data.items.map((item) => {
        return <img  src={item.snippet.thumbnails.url.default} />
    })

    return (
        <h1> {test} </h1>
    )
}

export default VideoList;
